import React, {Component} from 'react';
import { Layout } from 'antd';

class App extends Component {
  render(){
    return (
        <Layout>
          <Layout.Header>
            <p>Coisa</p>
          </Layout.Header>
        </Layout>
    );
  }
}


export default App;
